  const getAllMovies = async () => {
    const res = await axios.get("https://api.themoviedb.org/3/movie/popular?api_key=52ef927bbeb21980cd91386a29403c78&language=ar")
    console.log(res);
  }
  useEffect(()=> {
    getAllMovies()
  }, [])

  return (
    <div className="font color-body ">
      <NavBar />
      <Container>
            <MoviesList />

            {/* <MovieDetails /> */}
      </Container>
    </div>
  );
}

export default App;
